import React from 'react';

function App() {
  return (
  <div className="App" >
    <div className="mx-24 text-center">
    <img className="mt-24 h-5 m-auto" src="./images/logo.svg" alt="Logo"/>
    <h1 className="mt-16">We are launching <strong className="text-blue-dark">soon!</strong></h1>
    </div>
  </div>
  );
}

export default App;
